import Qs from "qs";
import { getTimeDate } from "@/utils/index.js";

export default {
  filters: {
    statusFilter(status) {
      const statusMap = {
        待审核: "info",
        审核通过: "warning",
        审核失败: "danger",
        已付款: "primary",
        发布成功: "success",
        任务完成: "danger",
        交易取消: "danger"
      };
      return statusMap[status];
    }
  },
  data() {
    return {
      list: null,

      form: {
        progress: "0",
        name: "",
        starttime: "",
        endtime: "",
        desc: "2",
        _uiName_: "eleme",
        _pagination: "{'pageNumber':1,'pageSize':5}"
      }
    };
  },
  created() {
    this.fetchData();
  },
  methods: {
    fetchData() {
      this.axios
        .get(this.urls.orderlist + "?" + Qs.stringify(this.form))
        .then(response => {
          this.list = response.data.list;
        });
    }
  }
};
